        private string MontarTransportadora(DanfeNFe entidade)
        {
            if (entidade.Transportadora == null) return "";

            var dic = new Dictionary<string, string>();
            dic.Add("#CpfCnpj#", Utils.FormatarCnpjCpf(entidade.Transportadora.CnpjCpf));
            dic.Add("#VehicleState#", entidade.Transportadora.Endereco.Uf);
            dic.Add("#VehiclePlate#", entidade.Transportadora.Placa);
            dic.Add("#VehicleRNTC#", entidade.Transportadora.CodAntt);
            dic.Add("#FreightMode#", entidade.Transportadora.FretePorConta);
            dic.Add("#CompanyName#", entidade.Transportadora.Nome);
            dic.Add("#CompanyNameStyle#", string.IsNullOrWhiteSpace(entidade.Transportadora.Nome) ? "font-size:0.8em;" : string.Empty);
            dic.Add("#IE#", entidade.Transportadora.Ie);
            dic.Add("#StateCode#", entidade.Transportadora.Endereco.Uf);
            dic.Add("#City#", entidade.Transportadora.Endereco.Cidade);
            dic.Add("#CityStyle#", string.IsNullOrWhiteSpace(entidade.Transportadora.Endereco.Cidade) ? "font-size:0.8em;" : string.Empty);
            dic.Add("#Street#", entidade.Transportadora.Endereco.NomeEnd?.ToUpper());
            dic.Add("#StreetStyle#",
                    string.IsNullOrWhiteSpace(entidade.Transportadora.Endereco.NomeEnd) ? "font-size:0.7em;" : string.Empty);
            var volume = MontarVolume(entidade);
            dic.Add("#Volumes#", volume);
            var reboque = MontarReboque(entidade);
            dic.Add("#Trailers#", reboque);
            return LerTemplateEsubstituirTags(Resources.Transport_Mod55, dic);
        }

        private string MontarReboque(DanfeNFe entidade)
        {
            var dic = new Dictionary<string, string>();
            var reboques = MontarReboques(entidade);
            dic.Add("#TrailerItems#", reboques);
            return LerTemplateEsubstituirTags(Resources.Trailer_Mod55, dic);
        }

        private string MontarReboques(DanfeNFe entidade)
        {
            
            if(entidade.Transportadora?.Reboque==null) return "";
            
            var stringBuilder = new StringBuilder();
            foreach (var item in entidade.Transportadora.Reboque)
            {
                var dic = new Dictionary<string, string>
                {
                        {"#Plate#", item.Placa},
                        {"#RNTC#",item.Rntc},
                        {"#StateCode#", item.Uf},
                         
                };
                stringBuilder.Append(LerTemplateEsubstituirTags(Resources.TrailerItem_Mod55, dic));
            }

            return stringBuilder.ToString();
        }

        private string MontarVolume(DanfeNFe entidade)
        {
            if (!entidade.Volumes.Any()) return "";

            var dic = new Dictionary<string, string>();
            var qtdVolumes = entidade.Volumes.Count;
            if (qtdVolumes == 1)
            {
                var item = entidade.Volumes.ToList()[0];
                var quantidade = item.Quantidade == null ? "" : item.Quantidade.ToString();
                dic.Add("#Quantity#", quantidade);
                dic.Add("#Specie#", item.Especie);
                dic.Add("#Brand#", item.Marca);
                dic.Add("#GrossWeight#", item.PesoBruto.FormatarNumero());
                dic.Add("#NetWeight#", item.PesoLiq.FormatarNumero());
                return LerTemplateEsubstituirTags(Resources.Volume_Mod55, dic);
            }

            var listVol = MontarVolumes(entidade);
            dic.Add("#VolumesItems#", listVol);
            return LerTemplateEsubstituirTags(Resources.VolumesListItem_Mod55, dic);
        }

        private string MontarVolumes(DanfeNFe entidade)
        {
            var str = new StringBuilder();
            foreach (var item in entidade.Volumes)
            {
                var dic = new Dictionary<string, string>();
                dic.Add("#Quantity#", item.Quantidade.ToString());
                dic.Add("#Specie#", item.Especie.ToString());
                dic.Add("#Brand#", item.Marca);
                dic.Add("#GrossWeight#", item.PesoBruto.FormatarNumero());
                dic.Add("#NetWeight#", item.PesoLiq.FormatarNumero());
                str.Append(LerTemplateEsubstituirTags(Resources.VolumesListItem_Mod55, dic));
            }

            return str.ToString();
        }

        private string CalculoImpostos(DanfeNFe entidade)
        {
            var dic = new Dictionary<string, string>();
            dic.Add("#ICMSCalculationBasisAmount#", entidade.Imposto.vBCIMS.FormatarNumeroDanfe());
            dic.Add("#ICMSAmount#", entidade.Imposto.vICMS.FormatarNumeroDanfe());
            dic.Add("#ICMSSTCalculationBasisAmount#", entidade.Imposto.vBCICMSST?.FormatarNumeroDanfe());
            dic.Add("#ICMSSTAmount#", entidade.Imposto.vICMSST?.FormatarNumeroDanfe());
            dic.Add("#ProductsAmount#", entidade.Imposto.vProd.FormatarNumeroDanfe());
            dic.Add("#FreightAmount#", entidade.Imposto.vFrete.FormatarNumeroDanfe());
            dic.Add("#InsuranceAmount#", entidade.Imposto.vSeg.FormatarNumeroDanfe());
            dic.Add("#DiscountAmount#", entidade.Imposto.vDesc.FormatarNumeroDanfe());
            dic.Add("#OtherExpensesAmount#", entidade.Imposto.vOutro.FormatarNumeroDanfe());
            dic.Add("#IPIAmount#", entidade.Imposto.vIpi.FormatarNumeroDanfe());
            dic.Add("#DocumentAmount#", entidade.Imposto.vNF.FormatarNumeroDanfe());
            return LerTemplateEsubstituirTags(Resources.Total_Mod55, dic);
        }

        private string MontarFatura(DanfeNFe entidade)
        {
            var dic = new Dictionary<string, string>();
            var itens = MontarItensFaturas(entidade);
            dic.Add("#InvoiceItems#", itens);
            return LerTemplateEsubstituirTags(Resources.Invoice_Mod55, dic);
        }

        private string MontarItensFaturas(DanfeNFe entidade)
        {
            var str = new StringBuilder();
            var pipe = entidade.Faturas.Count > 1 ? " | " : "";
            foreach (var item in entidade.Faturas)
            {
                var dic = new Dictionary<string, string>();
                var str1 = $"<b>N Fat.º</b>: {item.NumFatura} &nbsp";
                var str2 = $"<b>Vencimento</b>: {item.DataVencimento:dd/MM/yyyy} &nbsp";
                var str3 = $"<b>Valor</b>: {item.Valor.FormatarNumeroDanfe()} &nbsp";
                dic.Add("#BillItem#", $"{str1} {str2} {str3} {pipe}");
                str.Append(LerTemplateEsubstituirTags(Resources.InvoiceItem_Mod55, dic));
            }

            return str.ToString();
        }

        private string MontarDestinatario(DanfeNFe entidade)
        {
            var dic = new Dictionary<string, string>();
            dic.Add("#EmissionDate#", entidade.DataEmissao.ToString("dd/MM/yyyy"));
            dic.Add("#CompanyName#", entidade.Destinatario.Nome?.ToUpper());
            dic.Add("#CpfCnpj#", Utils.FormatarCnpjCpf(entidade.Destinatario.CnpjCpf));
            dic.Add("#InOutProductData#", entidade.DataEntSaida?.ToString("dd/MM/yyyy"));
            dic.Add("#ZipCode#", entidade.Destinatario.Endereco.Cep);
            dic.Add("#Neighborhood#", entidade.Destinatario.Endereco.Bairro);
            dic.Add("#Address#", entidade.Destinatario.Endereco.NomeEnd);
            dic.Add("#InOutProductDataTime#", entidade.DataEntSaida?.ToString("HH:mm:ss"));
            dic.Add("#IE#", string.IsNullOrWhiteSpace(entidade.Destinatario.Ie) ? "ISENTO" : entidade.Destinatario.Ie);
            dic.Add("#StateCode#", entidade.Destinatario.Endereco.Uf);
            dic.Add("#Phone#", entidade.Destinatario.Endereco.Tel);
            dic.Add("#City#", entidade.Destinatario.Endereco.Cidade);
            return LerTemplateEsubstituirTags(Resources.Recipient_Mod55, dic);
        }

        private string MontarEmitente(DanfeNFe entidade, string pagina)
        {
            var dic = new Dictionary<string, string>();
            dic.Add("#Logo#",
                    !string.IsNullOrEmpty(entidade.Emitente.Logo)
                            ? entidade.Emitente.Logo
                            : "data:image/png;base64,");
            dic.Add("#BarCode#", string.IsNullOrEmpty(entidade.Chave) ? string.Empty : MontarCodigoBarras(entidade.Chave));
            dic.Add("#CompanyName#", entidade.Emitente.Nome?.ToUpper());
            dic.Add("#VerificationCode#", string.IsNullOrEmpty(entidade.Chave) ? string.Empty : entidade.Chave.FormatarEspaco(4));
            dic.Add("#OperationType#", entidade.TipoOper);
            dic.Add("#Number#", entidade.NumNota);
            dic.Add("#Serie#", entidade.SerieNota);
            dic.Add("#IEST#", entidade.IeSt ?? string.Empty);
            dic.Add("#IE#", entidade.Emitente.Ie);
            dic.Add("#CpfCnpj#", Utils.FormatarCnpjCpf(entidade.Emitente.CnpjCpf));
            var natOper = string.IsNullOrWhiteSpace(entidade.NatOperacao) ? "" :
                    entidade.NatOperacao.Length > 55 ? entidade.NatOperacao?.ToUpper().Substring(0, 55) : entidade.NatOperacao?.ToUpper();
            dic.Add("#NatureOperation#", natOper);
            dic.Add("#Protocol#", entidade.ProtocoloUso ?? " - ");
            var fone = string.IsNullOrWhiteSpace(entidade.Emitente.Endereco.Tel)?"":$"Fone:{entidade.Emitente.Endereco.Tel}";
            var endereco = $"{entidade.Emitente.Endereco.NomeEnd} {entidade.Emitente.Endereco.Num} {entidade.Emitente.Endereco.Bairro} - {entidade.Emitente.Endereco.Cep} " +
                           $"{entidade.Emitente.Endereco.Cidade} - {entidade.Emitente.Endereco.Uf} {fone}";
            dic.Add("#Address#", endereco);
            dic.Add("#Page#", pagina);
            return LerTemplateEsubstituirTags(Resources.Issuer_Mod55, dic);
        }


