        private string MontarCodigoBarras(string nFeId)
        {
            return "data:image/png;base64, " + new Barcode(nFeId, Type.Code128).GetBase64Image();
        }

        /// <summary>
        ///     Rodape
        /// </summary>
        /// <param name="entidade"></param>
        /// <returns></returns>
        private string MontarRodape(DanfeNFe entidade)
        {
            string str1;
            var str2 = "";

            if (entidade.Producao)
            {
                switch (entidade.Status)
                {
                    case Status.Autorizada:
                        str1 = "";
                        break;
                    case Status.Cancelada:
                        str1 = "NOTA FISCAL CANCELADA";
                        break;
                    case Status.NaoAuotorizada:
                        str1 = "NOTA FISCAL DENEGADA";
                        break;
                    case Status.EsperandoAutorizacao:
                        str1 = "PRÉ-VISUALIZAÇÃO";
                        str2 = "SEM VALOR FISCAL";
                        break;
                    case Status.Negada:
                        str1 = "NOTA FISCAL DENEGADA";
                        break;
                    case Status.Recusada:
                        str1 = "SEM VALOR FISCAL";
                        break;
                    default:
                        throw new ArgumentOutOfRangeException();
                }

            }
            else
            {
                str1 = "HOMOLOGAÇÃO";
                str2 = "SEM VALOR FISCAL";
            }
            
            
            var dic = new Dictionary<string, string>();
            dic.Add("#WaterMark#", str1);
            dic.Add("#WithOutValue#", str2);


            return LerTemplateEsubstituirTags(Resources.Footer_Mod55, dic);
        }


