            var corpo = MontarCorpo(_danfe);
            var rodape = "";//MontarRodape(_danfe);
            var script = Resources.Script_Mod55;
            //===============================
            var str1 = MontagemPagina(cabecalho, corpo, rodape,script);
            return new Documento {Html = str1};
        }

        #endregion

        #region Produtos e Paginas

        /// <summary>
        ///     Montar produtos para  a primeira pagina
        /// </summary>
        /// <param name="totitens"></param>
        /// <param name="entidade"></param>
        /// <param name="numPag"></param>
        /// <param name="totPag"></param>
        /// <returns></returns>
        private string MontarProdutosPrimeiraPagina(int totitens, DanfeNFe entidade, int numPag, int totPag)
        {
            var strbProd = new StringBuilder();
            var prods = entidade.Produtos.ToList();
            var list = prods.Take(QTD_PRODS_PRIM_PAG).ToList(); //Obter da coleção a quantidade permitida para a primeira pagina
            foreach (var item in list)
            {

                #region Processar

                var dic = new Dictionary<string, string>();
                MontarProdutos(dic, item);
                var p1 = LerTemplateEsubstituirTags(Resources.Products_Mod55, dic);
                strbProd.Append(p1);

                #endregion

            }
          
            return strbProd.ToString();
        }

        /// <summary>
        /// </summary>
        /// <param name="entidade"></param>
        /// <param name="produtos"></param>
        /// <param name="totPag">Total de páginas</param>
        /// <returns></returns>
        private string MontarProdutosPorPagina(DanfeNFe entidade, List<Produto> produtos, int totPag)
        {
            var ii = 0;
            var idxIni = 0;
            var numPag = 2; //Numero da pagina inicial
            var totItens = produtos.Count; //Quantidade total da coleção
            var range = totItens <= QTD_PRODS_PRX_PAG
                    ? totItens
                    : QTD_PRODS_PRX_PAG; //Quantidade de itens por pagina,sendo total de itens menor que o range, entao alterar o range
            var strbProd = new StringBuilder();
            var strbTemplate = new StringBuilder();
            while (totItens > ii) //Enquanto não zerar a iteração por todos os itens, fazer
            {
                var list = produtos.GetRange(idxIni, range);
                strbProd.Clear();
                foreach (var item in list)
                {

                    #region Processar

                    var dic = new Dictionary<string, string>();
                    MontarProdutos(dic, item);
                    var p1 = LerTemplateEsubstituirTags(Resources.Products_Mod55, dic);
                    strbProd.Append(p1);

                    #endregion

                    ii++;
                }

                #region Processar 2

                var template1 = Resources.NextPage_Mod55;
                var dic1 = new Dictionary<string, string>();
                dic1.Add("#Products#", strbProd.ToString());
                dic1.Add("#WaterMark#", MarcaDagua(entidade));

                //Substituir tag Produtos
                var template2 = Substituir(template1, dic1);
                //Subsituir tag Emitente
                var emitente = MontarEmitente(entidade, $"{numPag} de {totPag}");
                var dic2 = new Dictionary<string, string>();
                dic2.Add("#Issuer#", emitente);
                dic2.Add("#WaterMark#", MarcaDagua(entidade));

                var template3 = Substituir(template2, dic2);
                strbTemplate.Append(template3);

                #endregion

                numPag++; //Numero da pagina no processamento
                idxIni += range;

                #region Calcular o intervalo dentro do range especificado para a coleção

                if (totItens - ii < range)
                {
                    range = totItens - ii;
                }
                else
                {
                    var count = totItens - range;
                    range = totItens > count ? range : count;
                }

                /*
                 Exemplo de intervalos considerando haver 33 itens na coleção
                 intervalos de 10 em  10
                 GetRange(0,10)
                 GetRange(10,10)
                 GetRange(20,10)
                 GetRange(30,3)
                 */

                #endregion

            }

            return strbTemplate.ToString();
        }

        private static void MontarProdutos(Dictionary<string, string> dic, Produto item)
        {
            dic.Add("#ProductCode#", item.Codigo);
            dic.Add("#Description#", $"{item.Descricao?.Trim()} {item.InfAdic?.Trim()}".Truncar(138));
            dic.Add("#NCM#", item.Ncm);
            dic.Add("#ProductOrigin#", item.Origem);
            dic.Add("#CFOP#", item.Cfop);
            dic.Add("#Unit#", item.Unidade);
            dic.Add("#Quantity#", item.Quantidade.FormatarNumeroQuantidadeDanfe());
            dic.Add("#UnityValue#", item.ValorUnitario.FormatarNumero());
            dic.Add("#Amount#", item.ValorTotal.FormatarNumero());
            dic.Add("#CalculationBasis#", item.BaseCalculo.FormatarNumero());
            dic.Add("#ICMSValue#", item.VIcms.FormatarNumero());
            dic.Add("#ICMSRate#", item.PIcms.FormatarNumero());
            dic.Add("#IPIValue#", item.ValorIpi?.FormatarNumero());
            dic.Add("#IPIRatePercentual#", item.PIpi?.FormatarNumero());
           
        }

        #endregion
    }
